import { Link } from 'react-router-dom';

const CourseList = ({ courses, query }) => {
  return (
    <div className='mt-10'>
      {courses
        .filter((course) =>
          course.Монгол_нэр.toLowerCase().includes(query.toLowerCase()),
        )
        .map((course) => (
          <div
            className='p-2.5 mt-5 mx-10 border border-gray-500 rounded-xl shadow-listShadow
            hover:cursor-pointer hover:shadow-xl'
            key={course.id}
          >
            <Link to={`/courses/${course.id}`}>
              <div className='course-box flex'>
                <h2 className='text-xl font-bold mb-3 '>{course.Монгол_нэр}</h2>
                <p>{course.Багц_цаг}</p>
              </div>
              <p className=''>{course.Хичээлийн_индекс}</p>
            </Link>
          </div>
        ))}
    </div>
  );
};

export default CourseList;
